export default {
	myVar1: [],
	myVar2: {},
	getRefunds: () => {
		const arr = GetAllOrders.data.map(x => parseInt(x.refundStatus))
		return ((arr.reduce((a, b) => a + b, 0))/(GetAllOrders.data.length)).toFixed(2)
	},
	getOnTimeDeliveries: () => {
		const arr = GetAllOrders.data.map(x => parseInt(x.On_time))
		return ((arr.reduce((a, b) => a + b, 0))/(GetAllOrders.data.length)).toFixed(2)
	},
	search: () => {
		if(Input1.text.length==0){
			return getCustomer.data
		}
		else{
			return(getAllCustomers.data.filter(word => word.CName.toLowerCase().includes(Input1.text.toLowerCase())))
		}
	}
}
